import React, { Component } from 'react';

import { Container, Row, Col } from 'react-bootstrap';

class Metrics extends Component {
  render() {
    return (
      <Container>
        <Row>
          <Col sm={3}>Visits</Col>
          <Col sm={9}>Graphs</Col>
        </Row>
      </Container>
    );
  }
}

export default Metrics;
